import React from "react";
import Card from "./Card";

const Service = () => {
    return (
        <>
            <div className="text-center my-5">
                <h1>Our Services</h1>
            </div>
            <div className="container-fluid">
                <div className="row">
                    <div className="col-10 mx-auto">
                        <Card/>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Service;
